import{e as i}from"./app.1ff4f7e2.js";import{_ as l}from"./plugin-vue_export-helper.21dcd24c.js";const e={},a=i('<h1 id="_17\u110C\u1161\u11BC-\u1102\u1162\u11B7\u1109\u1162\u110B\u116A-\u1112\u1172\u1105\u1175\u1109\u1173\u1110\u1175\u11A8" tabindex="-1"><a class="header-anchor" href="#_17\u110C\u1161\u11BC-\u1102\u1162\u11B7\u1109\u1162\u110B\u116A-\u1112\u1172\u1105\u1175\u1109\u1173\u1110\u1175\u11A8" aria-hidden="true">#</a> 17\uC7A5. \uB0C4\uC0C8\uC640 \uD734\uB9AC\uC2A4\uD2F1</h1><p>\uC4F8\uBAA8 \uC5C6\uB294 \uAC83\uB4E4\uC5D0 \uB300\uD574 \uC801\uC5B4\uBCF8\uB2E4.</p><h2 id="\u110C\u116E\u1109\u1165\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110C\u116E\u1109\u1165\u11A8" aria-hidden="true">#</a> \uC8FC\uC11D</h2><ul><li>C1(\uBD80\uC801\uC808\uD55C \uC815\uBCF4): \uB2E4\uB978 \uC2DC\uC2A4\uD15C\uC5D0 \uC800\uC7A5\uD560 \uC815\uBCF4\uB294 \uC8FC\uC11D\uC73C\uB85C \uB0A8\uAE30\uC9C0 \uB9D0\uC790.</li><li>C2(\uC4F8\uBAA8 \uC5C6\uB294 \uC8FC\uC11D): \uC8FC\uC11D\uC740 \uBE68\uB9AC \uB0A1\uAE30 \uB54C\uBB38\uC5D0 \uC4F8\uBAA8\uC5C6\uC5B4\uC9C8 \uC8FC\uC11D\uC774\uB2E4.</li><li>C3(\uC911\uBCF5\uB41C \uC8FC\uC11D): \uCF54\uB4DC\uB9CC\uC73C\uB85C \uCDA9\uBD84\uD55C\uB370 \uAD6C\uAD6C\uC808\uC808 \uC124\uBA85\uD558\uB294 \uC8FC\uC11D\uC740 \uD544\uC694\uC5C6\uB2E4.</li><li>C4(\uC131\uC758 \uC5C6\uB294 \uC8FC\uC11D): \uB9D0 \uADF8\uB300\uB85C\uB2E4. \uC131\uC758\uC5C6\uB294 \uC8FC\uC11D\uB4E4\uC740 \uC9C0\uC6B0\uC790.</li><li>C5(\uC8FC\uC11D\uC73C\uB85C \uCC98\uB9AC\uB41C \uCF54\uB4DC): <code>git</code>\uACFC \uAC19\uC740 \uC18C\uC2A4\uCF54\uB4DC \uAD00\uB9AC \uD504\uB85C\uADF8\uB7A8 \uB355\uC5D0 \uD544\uC694 \uC5C6\uB2E4.</li></ul><h2 id="\u1112\u116A\u11AB\u1100\u1167\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1112\u116A\u11AB\u1100\u1167\u11BC" aria-hidden="true">#</a> \uD658\uACBD</h2><ul><li>E1(\uC5EC\uB7EC \uB2E8\uACC4 \uBE4C\uB4DC): \uBE4C\uB4DC\uB294 \uAC04\uB2E8\uD788 \uD55C \uB2E8\uACC4\uB85C \uB05D\uB098\uC57C \uD55C\uB2E4.</li><li>E2(\uC5EC\uB7EC \uB2E8\uACC4 \uD14C\uC2A4\uD2B8): \uBAA8\uB4E0 \uB2E8\uC704 \uD14C\uC2A4\uD2B8\uB294 \uD55C \uBA85\uB839\uC73C\uB85C \uB3CC\uB824\uC57C \uD55C\uB2E4.</li></ul><h2 id="\u1112\u1161\u11B7\u1109\u116E" tabindex="-1"><a class="header-anchor" href="#\u1112\u1161\u11B7\u1109\u116E" aria-hidden="true">#</a> \uD568\uC218</h2><ul><li>F1(\uB108\uBB34 \uB9CE\uC740 \uC778\uC218): \uD568\uC218\uC758 \uC778\uC218 \uAC1C\uC218\uB294 \uC791\uC744\uC218\uB85D \uC88B\uB2E4. \uC544\uC608 \uC5C6\uC73C\uBA74 \uAC00\uC7A5 \uC88B\uB2E4.</li><li>F2(\uCD9C\uB825 \uC778\uC218): \uD568\uC218\uC5D0\uC11C \uBB54\uAC00\uC758 \uC0C1\uD0DC\uB97C \uBCC0\uACBD\uD574\uC57C \uD55C\uB2E4\uBA74 \uD568\uC218\uAC00 \uC18D\uD55C \uAC1D\uCCB4\uC758 \uC0C1\uD0DC\uB97C \uBCC0\uACBD\uD558\uC790.</li><li>F3(\uD50C\uB798\uADF8 \uC778\uC218): boolean \uC778\uC218\uB294 \uD568\uC218\uAC00 \uC5EC\uB7EC \uAE30\uB2A5\uC744 \uC218\uD578\uD55C\uB2E4\uB294 \uBA85\uBC31\uD55C \uC99D\uAC70\uB2E4. \uD50C\uB798\uADF8 \uC778\uC218\uB294 \uAC00\uB2A5\uD558\uBA74 \uD53C\uD558\uC790.</li><li>F4(\uC8FD\uC740 \uD568\uC218): \uC544\uBB34\uB3C4 \uD638\uCD9C\uD558\uC9C0 \uC54A\uB294 \uD568\uC218\uB294 \uC0AD\uC81C\uD558\uC790. <code>git</code>\uC774 \uBAA8\uB450 \uAE30\uC5B5\uD558\uB2C8\uAE4C \uC720\uC9C0\uD560 \uD544\uC694\uAC00 \uC5C6\uB2E4.</li></ul><h2 id="\u110B\u1175\u11AF\u1107\u1161\u11AB" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11AF\u1107\u1161\u11AB" aria-hidden="true">#</a> \uC77C\uBC18</h2><ul><li>G1(\uC18C\uC2A4\uD30C\uC77C \uB2F9 \uC5B8\uC5B4 \uD558\uB098): \uD55C \uC18C\uC2A4\uD30C\uC77C\uC5D0 \uC5B8\uC5B4 \uD558\uB098\uB9CC \uC0AC\uC6A9\uD558\uC790. <code>jsp</code>\uC640 \uAC19\uC774 \uC5EC\uB7EC \uC5B8\uC5B4\uAC00 \uD55C\uBC88\uC5D0 \uC0AC\uC6A9\uB418\uB294 \uACBD\uC6B0\uB294 \uD53C\uD558\uC790.</li><li>G2(\uD2B9\uC774\uD55C \uB3D9\uC791\uC744 \uD558\uB294 \uAE30\uB2A5): \uD504\uB85C\uADF8\uB798\uBA38\uAC00 \uB2F9\uC5F0\uD558\uAC8C \uC5EC\uAE38\uB9CC\uD558\uB3C4\uB85D(\uCF54\uB4DC\uB97C \uBCFC \uC77C\uC774 \uC5C6\uB3C4\uB85D) \uC9C1\uAD00\uC801\uC73C\uB85C \uB3D9\uC791\uACFC \uAE30\uB2A5\uC744 \uAD6C\uD604\uD558\uC790.</li><li>G3(\uC62C\uBC14\uB974\uC9C0 \uC548\uC740 \uACBD\uACC4): \uBAA8\uB4E0 \uACBD\uACC4 \uC870\uAC74\uC744 \uCC3E\uC544\uB0B4\uACE0, \uBAA8\uB4E0 \uACBD\uACC4 \uC870\uAC74\uC744 \uD14C\uC2A4\uD2B8\uD558\uB294 \uD14C\uC2A4\uD2B8 \uCF00\uC774\uC2A4\uB97C \uC791\uC131\uD558\uC790.</li><li>G4(\uC548\uC804 \uC808\uCC28 \uBB34\uC2DC): \uCEF4\uD30C\uC77C\uB7EC \uACBD\uACE0\uC640 \uAC19\uC740 \uC548\uC804 \uC808\uCC28\uB97C \uBB34\uC2DC\uD558\uC9C0 \uB9D0\uC790.</li><li>G5(\uC911\uBCF5): \uC911\uBCF5 \uC81C\uAC70! \uB354 \uB9D0\uD560 \uD544\uC694\uAC00 \uC788\uC744\uAE4C? \uC911\uBCF5\uC740 \uAC00\uB2A5\uD558\uBA74 \uBB34\uC870\uAC74 \uC81C\uAC70\uD558\uC790.</li><li>G6(\uCD94\uC0C1\uD654 \uC218\uC900): \uC81C\uB300\uB85C \uB41C \uCD94\uC0C1\uD654\uB97C \uD558\uC790. \uAE30\uCD08 \uD074\uB798\uC2A4\uC5D0 \uC720\uD2F8\uB9AC\uD2F0 \uD568\uC218\uB97C \uB123\uC73C\uBA74 \uC548\uB418\uB4EF\uC774 \uB9D0\uC774\uB2E4.</li><li>G7(\uBD80\uBAA8 \uD074\uB798\uC2A4\uC758 \uC790\uC2DD \uC758\uC874): \uBD80\uBAA8 \uD074\uB798\uC2A4\uAC00 \uC790\uC2DD \uD074\uB798\uC2A4\uB97C \uBAA8\uB974\uAC8C \uD558\uC790. \uC758\uC874\uC131\uC774 \uC0DD\uAE30\uBA74 \uC548\uB41C\uB2E4.</li><li>G8(\uACFC\uB3C4\uD55C \uC815\uBCF4): \uC778\uD130\uD398\uC774\uC2A4\uB97C \uB9E4\uC6B0 \uC791\uAC8C \uADF8\uB9AC\uACE0 \uB9E4\uC6B0 \uAE50\uAE50\uD558\uAC8C \uB9CC\uB4E4\uC790. \uC815\uBCF4\uB97C \uC81C\uD55C\uD574 \uACB0\uD569\uB3C4\uB97C \uB0AE\uCD94\uC790.</li><li>G9(\uC8FD\uC740 \uCF54\uB4DC): \uC2E4\uD589\uC774 \uBD88\uAC00\uB2A5\uD55C \uC870\uAC74(\uD56D\uC0C1 false\uB77C\uB358\uAC00...)\uC744 \uAC00\uC9C4 \uC8FD\uC740 \uCF54\uB4DC\uB294 \uC81C\uAC70\uD558\uC790.</li><li>G10(\uC218\uC9C1 \uBD84\uB9AC): \uBCC0\uC218\uC640 \uD568\uC218\uB294 \uC0AC\uC6A9\uB418\uB294 \uC704\uCE58\uC5D0 \uAC00\uAE5D\uAC8C \uC815\uC758\uD574\uC57C \uD55C\uB2E4. <br><br></li><li>G11(\uC77C\uAD00\uC131 \uBD80\uC871): \uD45C\uAE30\uBC95\uC744 \uC77C\uAD00\uC131 \uC788\uAC8C \uD1B5\uC77C\uD558\uC790.</li><li>G12(\uC7A1\uB3D9\uC0AC\uB2C8): \uBE44\uC5B4 \uC788\uB294 \uAE30\uBCF8 \uC0DD\uC131\uC790\uC640 \uAC19\uC740 \uCF54\uB4DC\uB4E4\uC740 \uC81C\uAC70\uD558\uC790.</li><li>G13(\uC778\uC704\uC801 \uACB0\uD569): \uC11C\uB85C \uBB34\uAD00\uD55C \uAC1C\uB150\uC744 \uC778\uC704\uC801\uC73C\uB85C \uACB0\uD569\uD558\uC9C0 \uB9D0\uC790. \uD568\uC218, \uC0C1\uC218, \uBCC0\uC218\uB97C \uC120\uC5B8\uD560 \uB54C\uB294 \uC2DC\uAC04\uC744 \uB4E4\uC5EC \uC62C\uBC14\uB978 \uC704\uCE58\uB97C \uACE0\uBBFC\uD558\uC790.</li><li>G14(\uAE30\uB2A5 \uC695\uC2EC): \uD074\uB798\uC2A4 \uBA54\uC11C\uB4DC\uB294 \uB2E4\uB978 \uD074\uB798\uC2A4\uC758 \uBCC0\uC218\uC640 \uD568\uC218\uC5D0 \uAD00\uC2EC\uC744 \uAC00\uC9C0\uBA74 \uC548\uB41C\uB2E4.</li><li>G15(\uC120\uD0DD\uC790 \uC778\uC218): boolean\uACFC \uAC19\uC740 \uC120\uD0DD\uC790 \uC778\uC218\uB294 \uC0AC\uC6A9\uD558\uC9C0 \uB9D0\uC790.</li><li>G16(\uBAA8\uD638\uD55C \uC758\uB3C4): \uCF54\uB4DC\uB97C \uC9E4 \uB54C\uB294 \uC758\uB3C4\uB97C \uCD5C\uB300\uD55C \uBD84\uBA85\uD788 \uBC1D\uD78C\uB2E4.</li><li>G17(\uC798\uBABB \uC9C0\uC6B4 \uCC45\uC784): \uCF54\uB4DC \uBC30\uCE58\uD560 \uC704\uCE58, \uD568\uC218\uBA85 \uB4F1 \uB2E4\uB978 \uC0AC\uB78C\uC774 \uBCF4\uC544\uB3C4 \uBA85\uD655\uD788 \uC774\uD574\uAC00 \uAC00\uAC8C \uD558\uC790.</li><li>G18(\uBD80\uC801\uC808\uD55C static \uD568\uC218): \uD568\uC218\uB97C \uC7AC\uC815\uC758\uD560 \uAC00\uB2A5\uC131\uC774 \uC874\uC7AC\uD558\uBA74 static\uC73C\uB85C \uC120\uC5B8\uD558\uC9C0 \uB9D0\uC790.</li><li>G19(\uC11C\uC220\uC801 \uBCC0\uC218): \uACC4\uC0B0\uC744 \uC5EC\uB7EC \uB2E8\uACC4\uB85C \uB098\uB204\uACE0 \uC911\uAC04 \uAC12\uC73C\uB85C \uC11C\uC220\uC801\uC778 \uBCC0\uC218 \uC774\uB984\uC744 \uC0AC\uC6A9\uD558\uC790. <strong>\uC7AC\uC0AC\uC6A9\uC744 \uC548\uD558\uB354\uB77C\uB3C4 \uB9D0\uC774\uB2E4</strong>.</li><li>G20(\uC774\uB984\uACFC \uAE30\uB2A5\uC774 \uC77C\uCE58\uD558\uB294 \uD568\uC218): \uB0B4\uBD80 \uAD6C\uD604\uC744 \uC0B4\uD53C\uAC70\uB098 \uBB38\uC11C\uB97C \uB4A4\uC801\uC774\uC9C0 \uC54A\uB3C4\uB85D \uC774\uB984\uC744 \uC9D3\uC790. \uC774\uB984\uC744 \uC9D3\uAE30 \uC5B4\uB824\uC6B0\uBA74 \uC9D3\uAE30 \uC27D\uAC8C \uAE30\uB2A5\uC744 \uC815\uB9AC\uD558\uC790. <br><br></li><li>G21(\uC54C\uACE0\uB9AC\uC998\uC744 \uC774\uD574\uD558\uB77C): \uAE30\uB2A5\uC774 \uBED4\uD788 \uBCF4\uC77C \uC815\uB3C4\uB85C \uD568\uC218\uB97C \uAE54\uB054\uD558\uACE0 \uBA85\uD655\uD558\uAC8C <u>\uC7AC\uAD6C\uC131</u>\uD558\uC790.</li><li>G22(\uB17C\uB9AC\uC801 \uC758\uC874\uC131\uC740 \uBB3C\uB9AC\uC801\uC73C\uB85C \uB4DC\uB7EC\uB0B4\uB77C): \uC758\uC874\uD558\uB294 \uBAA8\uB4C8\uC774 \uC0C1\uB300 \uBAA8\uB4C8\uC5D0 \uB300\uD574 \uBB54\uAC00\uB97C \uAC00\uC815\uD558\uBA74(\uB17C\uB9AC\uC801\uC73C\uB85C \uC758\uC874\uD558\uBA74) \uC548\uB41C\uB2E4.</li><li>G23(\uB2E4\uD615\uC131\uC744 \uC0AC\uC6A9\uD558\uC790): \uAC00\uB2A5\uD558\uBA74 \uB2E4\uD615\uC131\uC744 \uC0AC\uC6A9\uD558\uC5EC \uAD6C\uD604\uD558\uACE0 switch\uBB38\uC740 \uD55C \uBC88\uB9CC \uC0AC\uC6A9\uD558\uB3C4\uB85D \uB9CC\uB4E4\uC790.</li><li>G24(\uD45C\uC900 \uD45C\uAE30\uBC95): \uB124\uC774\uBC0D \uBC29\uBC95, \uAD04\uD638 \uC704\uCE58 \uB4F1 \uD300\uC774 \uC815\uD55C \uD45C\uC900\uC744 \uB530\uB974\uC790.</li><li>G25(\uC22B\uC790\uB294 \uC0C1\uC218\uB85C \uAD50\uCCB4\uD558\uB77C): \uCF54\uB4DC\uC5D0 \uC22B\uC790\uB97C \uC9C1\uC811 \uC791\uC131\uD558\uC9C0 \uB9D0\uACE0 \uC0C1\uC218\uB85C \uB9CC\uB4E4\uC5B4\uC11C \uC0AC\uC6A9\uD558\uC790.</li><li>G26(\uC815\uD655\uD558\uB77C): \uCF54\uB4DC\uC5D0\uC11C \uBB54\uAC00\uB97C \uACB0\uC815\uD560 \uB54C\uB294 \uC815\uD655\uD788 \uACB0\uC815\uD558\uC790. \uACB0\uC815\uC744 \uB0B4\uB9AC\uB294 \uC774\uC720\uC640 \uC608\uC678\uCC98\uB9AC \uBC29\uBC95\uC744 \uBD84\uBA85\uD558\uAC8C \uC54C\uACE0 \uD558\uC790.</li><li>G27(\uAD00\uB840\uBCF4\uB2E4 \uAD6C\uC870): \uC124\uACC4 \uC132\uB801\uC744 \uAC15\uC81C\uD560 \uB54C\uB294 \uADDC\uC9C1\uBCF4\uB2E4 \uAD00\uB840\uB97C \uC0AC\uC6A9\uD558\uC790. \uBA85\uBA85 \uAD00\uB840\uB3C4 \uC88B\uC9C0\uB9CC \uAD6C\uC870 \uC790\uCCB4\uB85C \uAC15\uC81C\uD558\uBA74 \uB354 \uC88B\uB2E4.</li><li>G28(\uC870\uAC74\uC744 \uCEA1\uC290\uD654\uD558\uB77C): \uBD80\uC6B8 \uB17C\uB9AC\uB294 \uC870\uAC74\uC758 \uC758\uB3C4\uB97C \uBD84\uBA85\uD788 \uBC1D\uD788\uB294 \uD568\uC218\uB85C \uD45C\uD604\uD558\uC790.</li><li>G29(\uBD80\uC815 \uC870\uAC74\uC740 \uD53C\uD558\uB77C): \uAC00\uB2A5\uD558\uBA74 \uBD80\uC815 \uC870\uAC74 \uB300\uC2E0 \uAE0D\uC815 \uC870\uAC74\uC744 \uC0AC\uC6A9\uD558\uC790. <br><br></li><li>G30(\uD568\uC218\uB294 \uD55C \uAC00\uC9C0\uB9CC): \uD568\uC218\uB294 \uD55C \uAC00\uC9C0\uC758 \uAE30\uB2A5\uB9CC \uC218\uD589\uD574\uC57C \uD55C\uB2E4.</li><li>G31(\uC228\uACA8\uC9C4 \uC2DC\uAC04\uC801\uC778 \uACB0\uD569): \uC2DC\uAC04\uC801\uC778 \uACB0\uD569\uC774 \uD544\uC694\uD55C \uD568\uC218\uB4E4\uC740 \uC758\uC874\uC131\uC744 \uAC15\uD654\uD574\uC11C\uB77C\uB3C4 \uC2E4\uD589 \uC21C\uC11C\uB97C \uD655\uC2E4\uD558\uAC8C \uD560 \uC218 \uC788\uB3C4\uB85D \uD558\uC790.</li><li>G32(\uC77C\uAD00\uC131\uC744 \uC720\uC9C0\uD558\uB77C): \uCF54\uB4DC \uAD6C\uC870\uB97C \uC7A1\uC744 \uB584\uB294 \uC774\uC720\uB97C \uACE0\uBBFC\uD558\uACE0 \uADF8 \uC774\uC720\uB97C \uCF54\uB4DC \uAD6C\uC870\uB85C \uBA85\uBC31\uD558\uAC8C \uD45C\uD604\uD558\uC790.</li><li>G33(\uACBD\uACC4 \uC870\uAC74\uC744 \uCEA1\uC290\uD654\uD558\uB77C): \uACBD\uACC4 \uC870\uAC74\uC740 \uCEA1\uC290\uD654\uD558\uC5EC \uD55C \uACF3\uC5D0\uC11C \uBCC4\uB3C4\uB85C \uCC98\uB9AC\uD560 \uC218 \uC788\uAC8C \uD558\uC790.</li><li>G34(\uCD94\uC0C1\uD654 \uC218\uC900\uC740 \uD55C \uB2E8\uACC4\uB9CC \uB0B4\uB824\uAC00\uAC8C \uD558\uC790): \uCD94\uC0C1\uD654 \uC218\uC900\uC740 \uD568\uC218 \uC774\uB984\uC774 \uC758\uBBF8\uD558\uB294 \uC791\uC5C5\uBCF4\uB2E4 \uD55C \uB2E8\uACC4\uB9CC \uB0AE\uC544\uC57C \uD55C\uB2E4.</li><li>G35(\uC124\uC815 \uC815\uBCF4\uB294 \uCD5C\uC0C1\uC704 \uB2E8\uACC4\uC5D0 \uB46C\uB77C): \uC124\uC815\uC740 \uCD5C\uC0C1\uC704\uC5D0 \uB450\uC5B4\uC57C \uBCC0\uACBD\uD558\uAE30\uB3C4 \uC27D\uB2E4.</li><li>G36(\uCD94\uC774\uC801 \uD0D0\uC0C9\uC744 \uD53C\uD558\uB77C): \uB0B4\uAC00 \uC544\uB294 \uBAA8\uB4C8\uC774 \uC5F0\uC774\uC5B4 \uC790\uC2E0\uC774 \uC544\uB294 \uBAA8\uB4C8\uC744 \uB530\uB77C\uAC00\uBA70 \uC2DC\uC2A4\uD15C \uC804\uCCB4\uB97C \uD718\uC813\uAC8C \uD558\uC9C0 \uB9D0\uC790.</li></ul>',10);function r(d,G){return a}var c=l(e,[["render",r]]);export{c as default};
